  const [on, setOn] = useState(false);
  return (
    <div className="App">
      {/* {on ? <div> true </div>: <div>false</div>} */}
      {on && <div>true</div> }

      <button onClick={()=>setOn(true)}>show</button>
      <button onClick={() => setOn(false)}>hide</button>
    </div>
  );
}

export default App;
